import React from 'react';
import {
  Box,
  Flex,
  Text,
  Stack,
} from '@chakra-ui/react';

interface Props {
  children: React.ReactNode;
}

const NavLink = (props: Props) => {
  const { children } = props;

  return (
    <Box
      as="a"
      px={2}
      py={1}
      rounded={'md'}
      _hover={{
        textDecoration: 'none',
        color: 'blue.500',
      }}
      href={'#'}>
      {children}
    </Box>
  );
};

export default function Nav() {
  return (
    <>
      <Box
        className='navbar'
        width='100%'
        padding='1rem'
        backgroundColor='white'
        boxShadow='5px 10px 8px 5px rgba(0, 0, 0, 0.2)' // Grey box shadow
      >
        <Flex h={24} alignItems={'center'} justifyContent={'space-between'}>
          <Box display="flex" alignItems="center">
            <Text fontSize="xl" pl={1.5}>Shezi Pizza</Text>
            <img
              src="https://emojipedia-us.s3.amazonaws.com/source/skype/289/pizza_1f355.png"
              alt="Pizza Emoji"
              style={{ marginLeft: '10px', height: '36px' }}
            />
          </Box>

          <Flex alignItems={'center'}>
            <Stack direction={'row'} spacing={7}>
              <NavLink>Login</NavLink>
              <NavLink>Cart</NavLink>
            </Stack>
          </Flex>
        </Flex>
      </Box>
    </>
  );
}
